import React from 'react';
import {StyleSheet, Text} from 'react-native';
import {Avatar, Dropdown, Icon, Nav, Navbar} from 'rsuite';
;
const Mystyle={
  logoStyles:{
    marginLeft:"25px",
    marginTop:"8px",
    marginBottom:"18px"
  },
  textPosition:{
    paddingTop:'13px',
    paddingLeft:"3px",
  },
  textStyle:{
    fontSize:"30px",
    fontWeight:"bold",
    color:"#5987AF",
    textShadow:'1px 1px #ccc'
  }
}
const HeaderV=()=>{
  return(
    <Navbar appearance="inverse" style={{background:"#444444"}}>
    <Navbar.Header>
    </Navbar.Header>
    <Navbar.Body>
      <Nav pullRight style={{marginBottom:"5px",marginRight:"40px",marginLeft:'-10px'}}>
  <Nav.Item > <Avatar
    style={{border:"2px solid #5987AF",width:'38px',height:'38px',}}
      circle
      size="sm"
      src="https://avatars2.githubusercontent.com/u/12592949?s=460&v=4"
    /></Nav.Item>
      </Nav>
      <Nav  pullRight style={{marginTop:'6px'}}>
  <Nav.Item  icon={<Icon icon="home" style={{color:'white'}} />}>
   Home</Nav.Item>
        <Nav.Item>News</Nav.Item>
        <Nav.Item>Products</Nav.Item>
        <Dropdown  title="About">
          <Dropdown.Item>Company</Dropdown.Item>
          <Dropdown.Item>Team</Dropdown.Item>
          <Dropdown.Item>Contact</Dropdown.Item>
        </Dropdown>
      </Nav>
      <Nav>
        <img src ="https://i.ibb.co/H4r74P1/trag-icon.png" width="40" height="40" style={StyleSheet.flatten([Mystyle.logoStyles])}/>
        </Nav>
        <Nav  style={StyleSheet.flatten([Mystyle.textPosition])}>
        <Text  style={StyleSheet.flatten([Mystyle.textStyle])}>
          Trag
        </Text>
      </Nav>
    </Navbar.Body>
  </Navbar>
  )
}
export default HeaderV;
